import React from 'react';

const Contact = () => {
  return (
    <section id="contacts" className="py-20 bg-warmBeige text-darkBlue text-center">
      <h2 className="text-3xl mb-8 font-semibold">Contact</h2>
      <p className="text-lg">Feel free to reach out for any opportunities!</p>
    </section>
  );
};

export default Contact;
